import React from 'react';
class Counter extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      post: [
        { id: 1, value: 4 },
        { id: 2, value: 5 },
        { id: 3, value: 6 },
      ],
    };
  }

  componentDidMount = () => {
    this.setState({
      post: this.state.post,
    });
  };
  render() {
    const { post } = this.state;
    return (
      <h1>
        Hello you
        {post.map((post) => {
            return(<div className='content' key={post.id}>
            {post.value}
          </div>)
          
        })}
      </h1>
    );
  }
}

export default Counter;
